import React from 'react';
import { createDrawerNavigator } from "@react-navigation/drawer";
import  Ionicons  from 'react-native-vector-icons/Ionicons'; 

import {
  DetailStoryScreen,
  ReadingScreen
} from '../ScreemFolder/StoryScreen';
import {DrawerChapterContent} from '../Components';
import { HomeStackScreen } from '../NavigationScreen';

const Drawer = createDrawerNavigator();
const DrawerChapterStack =({ navigation })=> (
<Drawer.Navigator 
  //drawerContent={props => <DrawerChapterContent {...props}/>} 
  mode="modal"
>
    <Drawer.Screen 
      name="Reading" 
      component={ReadingScreen} 
    />
    <Drawer.Screen name="Home" component={HomeStackScreen}/>
    <Drawer.Screen name="DetailStory" component={DetailStoryScreen}/>
  </Drawer.Navigator>
)
export {DrawerChapterStack}
